import React from 'react'
import './projects.css'

function projects({img,link,xd,alt}) {
  return (
    <div >
      <article className='project-card'>
        <a href={link}>
            <img src={img} alt={alt}/>
        </a>
        {console.log(img)}
      </article>
      <a href={xd}>Adobe XD link</a>
    </div>
  )
}

export default projects
